import React from "react";
import Repository from "./Repository";



const Repositories = props => {
    return(
        <div>
        { props.repositories.map((repository , index) => {
            return (
            <div key= { index }>
                <h2> { repository.name }</h2>
                <h3>Commits</h3>
                { repository.commits.map((repository , index) => {
                    return (
                    <div key= { index }>
                        <h2> { repository.url }</h2>
                    </div>
                )})
                }
                <Repository repository= { repository.commits} />
                <a href= { repository.link } >See on Github</a>
            </div>
            )})
        }
        </div>
    )
}


export default Repositories
